import React from 'react'



const Cart = ({ product }) => {


    return (
        <div className=" col-12">
            <div className="row">
                <div className="col-3">
                    <img src={product.image} alt='' className="img-fluid" />
                </div>
                <div className="col-5">
                    
                    <b>{product.name} </b>

                    <h5>
                        <span className="badge bg-primary">R${product.price}</span>
                    </h5>
                    
                </div>

            </div>
        </div>
    );
};

export default Cart;
